// NavBar.js

import React, { useContext } from 'react';
import { Nav, Navbar } from 'react-bootstrap';
import { NavLink } from 'react-router-dom';
import { LOGIN_ROUTE, REGISTRATION_ROUTE, HOME_ROUTE } from '../utils/consts';
import { Context } from '../index';

const NavBar = () => {
    const { user } = useContext(Context);

    return (
        <Navbar bg="dark" variant="dark">
            <NavLink to={HOME_ROUTE} className="navbar-brand">
                Your App
            </NavLink>
            <Nav className="mr-auto">
                {user.isAuth ? (
                    <>
                        <Nav.Link as={NavLink} to={HOME_ROUTE}>
                            Home
                        </Nav.Link>
                        {user.user.role === 'EMPLOYER' && (
                            <Nav.Link as={NavLink} to="/data-for-employer">
                                Employer Data
                            </Nav.Link>
                        )}
                        {user.user.role === 'ADMIN' && (
                            <Nav.Link as={NavLink} to="/data-for-admin">
                                Admin Data
                            </Nav.Link>
                        )}
                        <Nav.Link onClick={() => user.setIsAuth(false)}>Logout</Nav.Link>
                    </>
                ) : (
                    <>
                        <Nav.Link as={NavLink} to={LOGIN_ROUTE}>
                            Login
                        </Nav.Link>
                        <Nav.Link as={NavLink} to={REGISTRATION_ROUTE}>
                            Registration
                        </Nav.Link>
                    </>
                )}
            </Nav>
        </Navbar>
    );
};

export default NavBar;
